import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css'; 
import Home from "./components/Home";
import Header from "./components/Header";


function App() {
  <Router>
  <Route path="/" exact component={Home} />
  <Route path="/about" component={About} />
</Router>
    return (
      <>
        <Header />
        <Home/>
      </>
    );
  }
 export default App;
